import "./styles.css";
import { useForm } from "react-hook-form";
import { Container } from "@material-ui/core";

export default function AddUser(){
    const {
        register,
        formState: { errors },
        handleSubmit
      } = useForm();

      const onSubmit = (data) => console.log(data);

      return (
        <Container>
          <div className="MyForm">
            <form onSubmit={handleSubmit(onSubmit)}>
              <h1>React-Hook-Form</h1>
              <CustomNameInput
                label="FirstName"
                register={register}
                errors={errors}
              />
              <CustomNameInput
                label="LastName"
                register={register}
                errors={errors}
              />
              <CustomNumberInput
                label="Phone-Number"
                register={register}
                errors={errors}
              />

              <input type="submit" />
            </form>
          </div>
        </Container>
      );
}
